import React from 'react'
import TeamMember from './TeamMember';

function Team(){

    const info = [
        {id:1, img: "/images/02.png", name: "Ghadah", position: "SudiArabia", phone: "966590796887", email: "ghadah.gmail.com", website: "ghada.com",},
        {id:2, img: "/images/01.png", name: "Lama",   position: "SudiArabia", phone: "966590796887", email: "lama.gmail.com",   website: "lama.com",},
        {id:3, img: "/images/03.png", name: "Bushra", position: "SudiArabia", phone: "966590796887", email: "bushra.gmail.com", website: "bushra.com",},
        {id:4, img: "/images/04.jpg", name: "Leen",   position: "SudiArabia", phone: "966590796887", email: "leen.gmail.com",   website: "leen.com", },
        {id:5, img: "/images/05.jpg", name: "Samar",  position: "SudiArabia", phone: "966590796887", email: "samar.gmail.com",  website: "samar.com",},
        {id:6, img: "/images/06.jpg", name: "Razan",  position: "SudiArabia", phone: "966590796887", email: "razan.gmail.com",  website: "razan.com",}
    ]

const member = info.map(function(member){
    return  <TeamMember 
                img = {member.img}
                name = {member.name} 
                position = {member.position}
                phone = {member.phone}
                email = {member.email}
                website = {member.website}
    />
});
return (
    <div className='row'>
        {member}
    </div>
)
}

export default Team;
